import React from 'react';
import './App.css';

import 
{
  Header,
  AboutMe,
  Resume,
  Projects,
  Contact
} from './components/index.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Header />
      </header>

      <AboutMe />
      <Projects />
      <Resume />
      <Contact />
    </div>
  );
}

export default App;
